import image1 from "./image1.png";

export default function Header() {
    return (
      <header className="App-header">
        <nav className="nav">
        <img src={image1} className="image1" alt="image1" />
        <ul className="nav-items">
        <li className="nav-">Pricing</li>
        <li>About</li>
        <li>Contact</li>
        </ul>
        </nav>
      </header>
    )
  }
